INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('14631','cms','','','','','','group04_box2_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"44\";s:19:\"place_holder_height\";s:2:\"12\";}','<p>滹沱河畔热潮涌动，繁峙县畜牧业发展方兴未艾。昔日的荒沟荒坡，现在成了繁峙人眼里的风水宝地各类养殖小区在该县境内遍地开花，呈现出&ldquo;憨猪拱门丶牛气冲天丶喜气洋洋&rdquo;的强势发展势头。</p>\r\n\r\n<p>今年以来，繁峙县把发展生态畜牧业作为产业转型脱贫攻坚的主打产业抓紧不放，加大政策扶持力度，强力推进养殖小区建设，构建标准化丶产业化现代化经营模式...<a href=\"#\">&lt;详情&gt;</a></p>\r\n','$label[group04_box2_con1]','0','1489655938','1725846959','300','index','1489655938','');
