INSERT INTO `p8_label` (`id`,`system`,`module`,`site`,`env`,`source_system`,`source_module`,`name`,`type`,`option`,`content`,`invoke`,`variable`,`timestamp`,`last_update`,`ttl`,`postfix`,`update_time`,`last_setter`) VALUES ('16631','cms','item','','','','','list_solution2_con1','html','a:4:{s:7:\"bgcolor\";s:0:\"\";s:13:\"allowed_roles\";a:0:{}s:18:\"place_holder_width\";s:2:\"60\";s:19:\"place_holder_height\";s:2:\"20\";}','<p>中鑫之宝汽车服务有限公司，简称中鑫之宝， 2004年诞生于河南郑州，是一家集豪华汽车销售、豪华车售后服务、汽车保险销售与代理、汽车美容与改装等为一体的独立豪华汽车专业服务企业。销售及服务车型涵盖奔驰、宝马、奥迪、保时捷、路虎、捷豹、沃尔沃、进口大众等豪华汽车品牌以及劳斯莱斯、宾利、法拉利、兰博基尼等超豪华品牌。</p>\r\n\r\n<p>经过13年的发展和积淀，中鑫之宝建立了覆盖全国12省60余家综合性运营店面，为豪华车用户提供全面、专业、便捷的优质服务。    </p>\r\n\r\n<p>成立13年来，中鑫之宝已累计维修了百万余台次豪华汽车，服务了全国各地200万余高端客户。2014年，中鑫之宝品牌荣获河南省著名商标；2015年，中鑫之宝又一举斩获中国汽车后市场优秀连锁品牌殊荣；2016年，中鑫之宝荣获中国汽车售后服务客户满意度调查——快修连锁集团独立售后体系客户满意度第一名；并获得“2016中国汽车后市场百强终端”荣誉称号及“最具影响力奖”！</p>\r\n\r\n<p>荣誉是认可，亦是鼓励，在豪华车服务的道路上中鑫之宝正以根植河南，服务全国的战略布局稳步前行!</p>\r\n','$label[list_solution2_con1]','0','1509345427','1725519219','300','','1509345427','');
